import React, { Component } from 'react';

export default class StockCard extends Component {
  render() {

    return (
      <div style={{"margin": "10px",
      "width": "50%",
      "padding": "30px",
      "color": "green"}} key={this.props.stock.id}>
        <h3>{this.props.stock.name}</h3>

      </div>
    );
  }
}
